  constructor() {
    super()
    this.state = {
      robots: robots,
      searchfield: ''

    }
  }
  render() {
    return (<div className='tc'>
      <h1>RoboFriends</h1>
      <SearchBox1/>
      <CardList robots={robots}/>
    </div>);
  }
}

export default App;
